INSERT INTO `wp_ig_mailing_queue` (`id`, `hash`, `campaign_id`, `subject`, `body`, `count`, `status`, `start_at`, `finish_at`, `meta`, `created_at`, `updated_at`) VALUES
(1, 'obrzhk-hwtmnk-dbghyv-yqkbpc-qtvrnj', 1, 'Welcome To Email Subscribers', '<strong style=\"color: #990000\">What can you achieve using Email Subscribers?</strong><p>Add subscription forms on website, send HTML newsletters & automatically notify subscribers about new blog posts once it is published. You can also Import or Export subscribers from any list to Email Subscribers.</p> <strong style=\"color: #990000\">Plugin Features</strong><ol> <li>Send notification emails to subscribers when new blog posts are published.</li> <li>Subscribe form available with 3 options to setup.</li> <li>Double Opt-In and Single Opt-In support.</li> <li>Email notification to admin when a new user signs up (Optional).</li> <li>Automatic welcome email to subscriber.</li> <li>Auto add unsubscribe link in the email.</li> <li>Import/Export subscriber emails to migrate to any lists.</li> <li>Default WordPress editor to create emails.</li> </ol> <strong>Thanks & Regards,</strong><br>Admin', 2, 'Sent', '2020-03-04 11:59:42', '2020-03-04 11:59:51', NULL, '2020-03-04 11:59:42', '2020-03-04 11:59:42'),
(2, 'gzeisq-hdxnyt-aztsdh-vnwjkm-ocdjmi', 2, 'New Post Published - Hello world!', '<p>Hello {{NAME}},</p>\n<p>We have published a new blog article on our website : Hello world!</p>\n<p>You can view it from this link : <a href=\'http://localhost/ecommerce/hello-world/\' target=\'_blank\'>http://localhost/ecommerce/hello-world/</a></p>\n<p>Thanks &#038; Regards,<br />\nAdmin</p>\n<p>You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.</p>\n', 2, 'Sent', '2020-03-04 11:59:54', '2020-03-04 12:00:01', NULL, '2020-03-04 11:59:54', '2020-03-04 11:59:54');
