(220, 1, '2020-03-03 22:55:10', '2020-03-03 17:55:10', '<!-- wp:heading -->\r\n<h2>Who we are</h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>Our website address is: http://localhost/ecommerce.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading -->\r\n<h2>What personal data we collect and why we collect it</h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>Comments</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor’s IP address and browser user agent string to help spam detection.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>Media</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>Contact forms</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>Cookies</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>Embedded content from other websites</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>Analytics</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading -->\r\n<h2>Who we share your data with</h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading -->\r\n<h2>How long we retain your data</h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading -->\r\n<h2>What rights you have over your data</h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading -->\r\n<h2>Where we send your data</h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>Visitor comments may be checked through an automated spam detection service.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading -->\r\n<h2>Your contact information</h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading -->\r\n<h2>Additional information</h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>How we protect your data</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>What data breach procedures we have in place</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>What third parties we receive data from</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>What automated decision making and/or profiling we do with user data</h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3>Industry regulatory disclosure requirements</h3>\r\n<!-- /wp:heading -->', 'Privacy Policy', '', 'inherit', 'closed', 'closed', '', '3-revision-v1', '', '', '2020-03-03 22:55:10', '2020-03-03 17:55:10', '', 3, 'http://localhost/ecommerce/3-revision-v1/', 0, 'revision', '', 0),
(221, 1, '2020-03-03 23:15:26', '2020-03-03 18:15:26', '[et_pb_section fb_built=\"1\" fullwidth=\"on\" _builder_version=\"3.22.7\" background_image=\"http://localhost/ecommerce/wp-content/uploads/2020/03/help-1.jpg\"][et_pb_fullwidth_image src=\"http://localhost/ecommerce/wp-content/uploads/2020/03/help-1.jpg\" _builder_version=\"3.22.7\"][/et_pb_fullwidth_image][/et_pb_section][et_pb_section fb_built=\"1\" _builder_version=\"3.22.7\"][et_pb_row _builder_version=\"3.22.7\"][et_pb_column type=\"4_4\" _builder_version=\"3.22.7\"][et_pb_text _builder_version=\"3.22.7\" header_font=\"|600|||||||\" header_font_size=\"75px\"]<h1>Help Center</h1>\n[/et_pb_text][et_pb_accordion open_toggle_text_color=\"#000000\" open_toggle_background_color=\"#ffffff\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#000000\" _builder_version=\"3.22.7\" body_font=\"||||||||\" body_text_align=\"left\" body_font_size=\"13px\" toggle_level=\"h6\" toggle_font=\"||||||||\" border_width_all=\"2px\" border_color_all=\"#8300e9\"][et_pb_accordion_item title=\"Why was my order closed?\" open=\"on\" open_toggle_text_color=\"#000000\" open_toggle_background_color=\"#ffffff\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#f2f2f2\" _builder_version=\"3.22.7\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\" border_width_all=\"2px\" border_color_all=\"#8300e9\" text_orientation=\"left\"]<p><strong data-spm-anchor-id=\"0.0.0.i1.f3aa4300KCXM9H\"><span> </span>Security reason:</strong></p>\n<p>Scenario A: Coupon/discount has been used already by the same user. Please exclude coupon/discount for ordering again.</p>\n<p>Scenario B: Incomplete information of order. Please input complete name information for ordering again.</p>\n<p>Refund: you will receive refund within 20 working days, but some banks would hold this payment in this situation, you are advised to contact the bank.</p>[/et_pb_accordion_item][et_pb_accordion_item title=\"How do I stop a seller sending message?\" open=\"off\" open_toggle_background_color=\"#ffffff\" closed_toggle_background_color=\"#ededed\" _builder_version=\"3.22.7\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\" border_width_all=\"2px\" border_color_all=\"#8300e9\"]<p><span>We are afraid to say that there is no blacklist function currently. We are rapidly optimizing and enriching the functions of Instant Messaging, and striving to bring you an improved experience as soon as possible.</span></p>[/et_pb_accordion_item][et_pb_accordion_item title=\"I forget my account. How to retrieve it?\" open=\"off\" open_toggle_text_color=\"#000000\" open_toggle_background_color=\"#ffffff\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#f2f2f2\" _builder_version=\"3.22.7\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<p data-spm-anchor-id=\"0.0.0.i12.f3aa4300KCXM9H\">Use the first 6 &amp; last 4 digits of the card number, together with the amount &amp; date of the payment, and you will be able to get the account ID.</p>\n<p>Then you may sign in directly or recover password with the account ID.</p>\n<p>&nbsp;</p>[/et_pb_accordion_item][et_pb_accordion_item title=\"How do I cancel an order?\" open=\"off\" open_toggle_text_color=\"#000000\" open_toggle_background_color=\"#ffffff\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#f4f4f4\" _builder_version=\"3.22.7\" title_tex