(226, 1, '2020-03-03 23:15:18', '2020-03-03 18:15:18', '[et_pb_section fb_built=\"1\" _builder_version=\"3.22.7\"][/et_pb_section][et_pb_section fb_built=\"1\" fullwidth=\"on\" _builder_version=\"3.22.7\"][et_pb_fullwidth_image src=\"http://localhost/ecommerce/wp-content/uploads/2020/03/faq-bg-img.png\" _builder_version=\"3.22.7\"][/et_pb_fullwidth_image][/et_pb_section][et_pb_section fb_built=\"1\" _builder_version=\"3.22.7\"][et_pb_row _builder_version=\"3.22.7\"][et_pb_column type=\"4_4\" _builder_version=\"3.22.7\"][et_pb_text header_font_size=\"86px\" _builder_version=\"3.22.7\" header_font=\"|600|||||||\"]<h1>Help Center</h1>\n[/et_pb_text][et_pb_accordion _builder_version=\"3.22.7\" toggle_font=\"||||||||\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#f4f4f4\"][et_pb_accordion_item title=\"Why was my order closed?\" _builder_version=\"3.22.7\" open=\"on\" closed_toggle_text_color=\"#ffffff\" closed_toggle_background_color=\"#8300e9\" open_toggle_text_color=\"#000000\" open_toggle_background_color=\"#ffffff\" border_width_all=\"2px\" border_color_all=\"#8300e9\"]<p><strong data-spm-anchor-id=\"0.0.0.i1.f3aa4300KCXM9H\"><span> </span>Security reason:</strong></p>\n<p>In order to ensure the safety of your payment, AliExpress will execute a verification process for every order. Some orders may be closed due to potential security reasons, including but not limited to:</p>\n<p>Scenario A: Coupon/discount has been used already by the same user. Please exclude coupon/discount for ordering again.</p>\n<p>Scenario B: Incomplete information of order. Please input complete name information for ordering again.</p>\n<p>Refund: you will receive refund within 20 working days, but some banks would hold this payment in this situation, you are advised to contact the bank.</p>\n[/et_pb_accordion_item][et_pb_accordion_item title=\"How do I stop a seller sending message?\" _builder_version=\"3.22.7\" open_toggle_background_color=\"#8300e9\" border_color_all=\"#8300e9\" border_width_all=\"2px\" open=\"off\"]<p><span>We are afraid to say that there is no blacklist function currently. We are rapidly optimizing and enriching the functions of Instant Messaging, and striving to bring you an improved experience as soon as possible.</span></p>\n[/et_pb_accordion_item][/et_pb_accordion][/et_pb_column][/et_pb_row][/et_pb_section]', 'Help Center', '', 'inherit', 'closed', 'closed', '', '221-revision-v1', '', '', '2020-03-03 23:15:18', '2020-03-03 18:15:18', '', 221, 'http://localhost/ecommerce/221-revision-v1/', 0, 'revision', '', 0),
