(366, 1, '2020-03-04 22:56:18', '2020-03-04 17:56:18', '[et_pb_section fb_built=\"1\" fullwidth=\"on\" _builder_version=\"3.22.7\"][et_pb_fullwidth_image src=\"http://localhost/ecommerce/wp-content/uploads/2020/03/faq-bg-img.png\" _builder_version=\"3.22.7\"][/et_pb_fullwidth_image][/et_pb_section][et_pb_section fb_built=\"1\" _builder_version=\"3.22.7\"][et_pb_row _builder_version=\"3.22.7\"][et_pb_column type=\"4_4\" _builder_version=\"3.22.7\"][et_pb_text _builder_version=\"3.22.7\" header_font=\"|600|||||||\" header_font_size=\"86px\"]<h1>Help Center</h1>[/et_pb_text][et_pb_accordion open_toggle_text_color=\"#000000\" open_toggle_background_color=\"#ffffff\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#000000\" _builder_version=\"3.22.7\" toggle_level=\"h6\" toggle_font=\"||||||||\" border_width_all=\"2px\" border_color_all=\"#8300e9\"][et_pb_accordion_item title=\"Why was my order closed?\" open=\"on\" open_toggle_text_color=\"#000000\" open_toggle_background_color=\"#ffffff\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#f2f2f2\" _builder_version=\"3.22.7\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\" border_width_all=\"2px\" border_color_all=\"#8300e9\" text_orientation=\"left\"]<p><strong data-spm-anchor-id=\"0.0.0.i1.f3aa4300KCXM9H\"><span> </span>Security reason:</strong></p>\n<p>Scenario A: Coupon/discount has been used already by the same user. Please exclude coupon/discount for ordering again.</p>\n<p>Scenario B: Incomplete information of order. Please input complete name information for ordering again.</p>\n<p>Refund: you will receive refund within 20 working days, but some banks would hold this payment in this situation, you are advised to contact the bank.</p>[/et_pb_accordion_item][et_pb_accordion_item title=\"How do I stop a seller sending message?\" open=\"off\" open_toggle_background_color=\"#ffffff\" closed_toggle_background_color=\"#ededed\" _builder_version=\"3.22.7\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\" border_width_all=\"2px\" border_color_all=\"#8300e9\"]<p><span>We are afraid to say that there is no blacklist function currently. We are rapidly optimizing and enriching the functions of Instant Messaging, and striving to bring you an improved experience as soon as possible.</span></p>[/et_pb_accordion_item][et_pb_accordion_item title=\"I forget my account. How to retrieve it?\" open=\"off\" open_toggle_text_color=\"#000000\" open_toggle_background_color=\"#ffffff\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#f2f2f2\" _builder_version=\"3.22.7\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<p data-spm-anchor-id=\"0.0.0.i12.f3aa4300KCXM9H\">Use the first 6 &amp; last 4 digits of the card number, together with the amount &amp; date of the payment, and you will be able to get the account ID.</p>\n<p>Then you may sign in directly or recover password with the account ID.</p>\n<p>&nbsp;</p>[/et_pb_accordion_item][et_pb_accordion_item title=\"How do I cancel an order?\" open=\"off\" open_toggle_text_color=\"#000000\" open_toggle_background_color=\"#ffffff\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#f4f4f4\" _builder_version=\"3.22.7\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<p>&nbsp;</p>\n<p><strong data-spm-anchor-id=\"0.0.0.i1.22314300k2PXmd\">Order shipped from outside China cannot be cancelled.</strong><span> You may try to contact seller for help.</span></p>\n<p>&nbsp;</p>[/et_pb_accordion_item][et_pb_accordion_item title=\"I have not received my order. What can I do?\" open=\"off\" open_toggle_text_color=\"#000000\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#f7f7f7\" _builder_version=\"3.22.7\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<p><span>You may try following methods to resolve the problem:</span></p>\n<p><strong>Method 1</strong><span>. </span><a href=\"https://service.aliexpress.com/page/knowledge?pageId=37&amp;category=1000022000&amp;knowledge=1060063468&amp;language=en\" target=\"_blank\" class=\"\" rel=\"noopener noreferrer\"><strong>Track the parcel<span> </span></strong></a><strong>to know the shipping status</strong><br /><span>Note: Invalid tracking number may be resulted from the late update of the shipping status. In this scenario, you may contact the seller to check.</span></p>\n<p><strong>Method 2</strong><span>. </span><strong>Contact seller for more info. or open a dispute to get refund</strong><span>. Make sure you open the dispute before the Buyer Protection period ends.</span></p>\n<p>&nbsp;</p>[/et_pb_accordion_item][/et_pb_accordion][/et_pb_column][/et_pb_row][/et_pb_section]', 'Help Center', '', 'inherit', 'closed', 'closed', '', '221-revision-v1', '', '', '2020-03-04 22:56:18', '2020-03-04 17:56:18', '', 221, 'http://localhost/ecommerce/221-revision-v1/', 0, 'revision', '', 0),
