ext_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<p>&nbsp;</p>\n<p><strong data-spm-anchor-id=\"0.0.0.i1.22314300k2PXmd\">Order shipped from outside China cannot be cancelled.</strong><span> You may try to contact seller for help.</span></p>\n<p>&nbsp;</p>[/et_pb_accordion_item][et_pb_accordion_item title=\"I have not received my order. What can I do?\" open=\"off\" open_toggle_text_color=\"#000000\" closed_toggle_text_color=\"#000000\" closed_toggle_background_color=\"#f7f7f7\" _builder_version=\"3.22.7\" title_text_shadow_horizontal_length=\"0em\" title_text_shadow_vertical_length=\"0em\" title_text_shadow_blur_strength=\"0em\" body_text_shadow_horizontal_length=\"0em\" body_text_shadow_vertical_length=\"0em\" body_text_shadow_blur_strength=\"0em\"]<p><span>You may try following methods to resolve the problem:</span></p>\n<p><strong>Method 1</strong><span>. </span><a href=\"https://service.aliexpress.com/page/knowledge?pageId=37&amp;category=1000022000&amp;knowledge=1060063468&amp;language=en\" target=\"_blank\" class=\"\" rel=\"noopener noreferrer\"><strong>Track the parcel<span> </span></strong></a><strong>to know the shipping status</strong><br /><span>Note: Invalid tracking number may be resulted from the late update of the shipping status. In this scenario, you may contact the seller to check.</span></p>\n<p><strong>Method 2</strong><span>. </span><strong>Contact seller for more info. or open a dispute to get refund</strong><span>. Make sure you open the dispute before the Buyer Protection period ends.</span></p>\n<p>&nbsp;</p>[/et_pb_accordion_item][/et_pb_accordion][/et_pb_column][/et_pb_row][/et_pb_section]', 'Help Center', '', 'inherit', 'closed', 'closed', '', '221-revision-v1', '', '', '2020-03-04 23:04:00', '2020-03-04 18:04:00', '', 221, 'http://localhost/ecomme